const superagent = require('superagent');

class FetchData extends React.Component{
    componentDidMount(){
        superagent
            .get('https://jsonplaceholder.typicode.com/user')
            .end((err, res) => {
                if (err) { return console.log(err); }
                alert(res.body);
                console.log(res.body);
                // console.log(res.);
              });
    }
    render(){
        return(
            <>
            <h1>hello</h1>
            </>
        )
    }
}

export default FetchData;
